    /**
     * 标准折线图
     */
    public void BasicLine() {
        GsonOption option = new GsonOption();
//        option.title(new Title().text("未来一周气温变化").subtext("纯属虚构"));
        option.tooltip(Trigger.axis);
        option.legend("最高气温", "最低气温");
        Toolbox toolbox = new Toolbox().show(true);
//        toolboxFeature(toolbox);
        option.calculable(true);
        option.xAxis(new CategoryAxis().boundaryGap(false).data("周一", "周二", "周三", "周四", "周五", "周六", "周日"));
        option.yAxis(new ValueAxis().axisLabel(new AxisLabel().formatter("{value} °C")));

        Line line = new Line();
        line.name("最高气温").data(11, 11, 15, 13, 12, 13, 10);
        line.markPoint(new MarkPoint().data(new PointData().type(MarkType.max).name("最大值"), new PointData().type(MarkType.min).name("最小值")));
        line.markLine(new MarkLine().data(new LineData().type(MarkType.average).name("平均值")));
        option.series().add(line);
        Line line1 = new Line();
        line1.name("最低气温").data(1, -2, 2, 5, 3, 2, 0);
        line1.markPoint(new MarkPoint().data(new PointData().type(MarkType.min).name("周最低").value(-2).xAxis(1f).yAxis(-1.5f)));
        line1.markLine(new MarkLine().data(new LineData().type(MarkType.average).name("平均值")));
        option.series().add(line1);
        Log.d("标准折线图", option.toString());
        mWebView.setJsonFromOption(option);
    }

    /**
     * 堆积折线图
     */
    private void StackLine() {
        GsonOption option = new GsonOption();
        option.tooltip(Trigger.axis);
        option.legend("邮件营销", "联盟广告", "视频广告", "直接访问", "搜索引擎");
//        toolboxFeature(option.toolbox());
        option.calculable(true);
        option.xAxis(new CategoryAxis().boundaryGap(false).data("周一", "周二", "周三", "周四", "周五", "周六", "周日"));
        option.yAxis(new ValueAxis());
        String[] names = {"邮件营销", "联盟广告", "视频广告", "直接访问", "搜索引擎"};
        int[][] datas = {{120, 132, 101, 134, 90, 230, 210}, {220, 182, 191, 234, 290, 330, 310}, {150, 232, 201, 154, 190, 330, 410},
                {320, 332, 301, 334, 390, 330, 320}, {820, 932, 901, 934, 1290, 1330, 1320}};
        for (int i = 0; i < names.length; i++) {
            Line line1 = new Line();
            line1.stack("总量");
            line1.name(names[i]);
            Log.e("TAB", datas[i].toString());
            List list = line1.data();
            for (int d : datas[i]) {
                list.add(d);
            }
            option.series().add(line1);
        }
        Log.d("堆积折线图", option.toString());
        mWebView.setJsonFromOption(option);
    }

    /**
     * 横向标准折线图
     */
    public void HorizontalBasicLine() {
        GsonOption option = new GsonOption();
//        option.title(new Title().text("未来一周气温变化").subtext("纯属虚构"));
        option.tooltip(Trigger.axis);
        option.tooltip().formatter("Temperature : <br/>{b}km : {c}°C");
        option.legend("高度(km)与气温(°C)变化关系");
        Toolbox toolbox = new Toolbox().show(true);
//        toolboxFeature(toolbox);
        option.calculable(true);
        option.xAxis(new ValueAxis().axisLabel(new AxisLabel().formatter("{value} °C")));
        AxisLabel axisLabel = new AxisLabel().formatter("{value} km");
        option.yAxis(new CategoryAxis().axisLabel(axisLabel).axisLine(new AxisLine().onZero(false)).boundaryGap(false)
                .data("0", "10", "20", "30", "40", "50", "60", "70", "80"));

        Line line = new Line();
        line.name("高度(km)与气温(°C)变化关系").data(15, -50, -56.5, -46.5, -22.1, -2.5, -27.7, -55.7, -76.5);
        line.itemStyle(new ItemStyle().normal(new Normal().lineStyle(new LineStyle().shadowColor("rgba(0,0,0,0.4)"))));
        line.smooth(true);

        option.series().add(line);
        Log.d("横向标准折线图", option.toString());
        mWebView.setJsonFromOption(option);
    }


    /**
     * 标准面积图
     */
    private void basicArea() {
        GsonOption option = new GsonOption();
//        option.title(new Title().text("某楼盘销售情况").subtext("纯属虚构"));
        option.tooltip(Trigger.axis);
        option.legend("意向", "预购", "成交");
//        toolboxFeature(option.toolbox());
        option.calculable(true);
        option.xAxis(new CategoryAxis().boundaryGap(false).data("周一", "周二", "周三", "周四", "周五", "周六", "周日"));
        option.yAxis(new ValueAxis());
        String[] names = {"成交", "预购", "意向"};
        int[][] datas = {{10, 12, 21, 54, 260, 830, 710}, {30, 182, 434, 791, 390, 30, 10}, {150, 232, 201, 154, 190, 330, 410},
                {1320, 1132, 601, 234, 120, 90, 20}};
        for (int i = 0; i < names.length; i++) {
            Line line1 = new Line();
            line1.name(names[i]);
            line1.smooth(true);
            line1.itemStyle().normal().areaStyle().setType("defalut");
            Log.e("TAB", datas[i].toString());
            List list = line1.data();
            for (int d : datas[i]) {
                list.add(d);
            }
            option.series().add(line1);
        }
        Log.d("标准面积图", option.toString());
        mWebView.setJsonFromOption(option);
    }

