    /**
     * 不等距折线图
     */
    private void doubleValueAxisLine() {
        GsonOption option = new GsonOption();
//        option.title(new Title().text("双数值轴折线").subtext("纯属虚构"));
        option.tooltip(Trigger.axis).tooltip().axisPointer(new AxisPointer().show(true).type(PointerType.cross).lineStyle(
                new LineStyle().type(LineType.dashed).width(1f)
        ));
        option.legend().data("数据1", "数据2");
//        toolboxFeature(option.toolbox());
        option.calculable(true).xAxis(new ValueAxis()).yAxis(new ValueAxis().axisLine(new AxisLine().lineStyle(new LineStyle().color("#dc143c"))));
        float[][] farr1 = {{1.5f, 10}, {5, 7}, {8, 8}, {12, 6}, {11, 12}, {16, 9}, {14, 6}, {17, 4}, {19, 9}};
        ArrayList<List<Float>> flist = new ArrayList<>();
        for (float[] fa : farr1) {
            List<Float> cache = new ArrayList<>();
            for (float f : fa) {
                cache.add(f);
            }
            flist.add(cache);
        }
        Line line = new Line().name("数据1");
        line.data().addAll(flist);
        line.markPoint(new MarkPoint().data(
                new PointData().type(MarkType.max).name("最大值").symbol(Symbol.circle).itemStyle(new ItemStyle().normal(new Normal().color("#dc143c").label(new Label().position(Position.top)))),
                new PointData().type(MarkType.max).name("最小值").symbol(Symbol.circle).itemStyle(new ItemStyle().normal(new Normal().color("#dc143c").label(new Label().position(Position.bottom)))),
                new PointData().type(MarkType.max).name("最大值").valueIndex(0).symbol(Symbol.circle).itemStyle(new ItemStyle().normal(new Normal().color("#1e90ff").label(new Label().position(Position.right)))),
                new PointData().type(MarkType.max).name("最大值").valueIndex(0).symbol(Symbol.circle).itemStyle(new ItemStyle().normal(new Normal().color("#1e90ff").label(new Label().position(Position.left))))));
        line.markLine(new MarkLine().data(
                //纵轴 默认
                new LineData().type(MarkType.max).name("最大值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c"))),
                new LineData().type(MarkType.min).name("最小值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c"))),
                new LineData().type(MarkType.average).name("平均值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c"))),
                //横轴
                new LineData().type(MarkType.max).valueIndex(0).name("最大值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c"))),
                new LineData().type(MarkType.min).valueIndex(0).name("最小值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c"))),
                new LineData().type(MarkType.average).valueIndex(0).name("平均值").itemStyle(new ItemStyle().normal(new Normal().color("#dc143c")))
        ));
        float[][] farr2 = {{1, 2}, {2, 3}, {4, 2}, {7, 5}, {11, 2}, {18, 3}};
        ArrayList<List<Float>> flist1 = new ArrayList<>();
        for (float[] fa : farr2) {
            List<Float> cache = new ArrayList<>();
            for (float f : fa) {
                cache.add(f);
            }
            flist1.add(cache);
        }
        Line line1 = new Line();
        line1.name("数据2").data().addAll(flist1);
        option.series(line, line1);
        Log.d("不等距折线图", option.toString());
        mWebView.setJsonFromOption(option);
    }

