    /**
     * 折线图
     */
    private void brokenLine() {
        GsonOption option = new GsonOption();
        option.tooltip(Trigger.axis).legend(new Legend().data("邮件营销", "联盟广告", "直接访问", "搜索引擎"));
//        toolboxFeature(option.toolbox());
        CategoryAxis xAxis = new CategoryAxis().boundaryGap(false).data("周一", "周二", "周三", "周四", "周五", "周六", "周日");
        option.calculable(true).xAxis(xAxis).yAxis(new ValueAxis());
        Line line1 = new Line();
        line1.name("邮件营销").stack("总量").symbol(Symbol.none).itemStyle(new ItemStyle().normal(new Normal().color("argb(255,0,0,0.5)")));
        line1.data(120, 132, 301, 134, 90, 230, 210);
        Line line2 = new Line();
        line2.name("联盟广告").stack("总量").smooth(true).symbolSize(8).symbol(Symbol.circle).itemStyle(new ItemStyle().normal(new Normal().color("#99ccff")));
        line2.data(120, 82, 201, 134, 90, 230, 110);
        Line line3 = new Line();
        line3.name("直接访问").stack("总量").smooth(true).symbolSize(6).symbol(Symbol.arrow).itemStyle(new ItemStyle().normal(new Normal().color("#ffcc99")));
        line3.data(320, 332, 334, 390, 330, 320, 110);
        Line line4 = new Line();
        Normal normal4 = new Normal().color("#ff99cc").shadowColor("rgba(0,0,0,0.5");
        normal4.setShadowBlur(10);
        normal4.setShadowOffsetX(8);
        normal4.setShadowOffsetY(8);
        ItemStyle itemStyle4 = new ItemStyle().normal(normal4).emphasis(new Emphasis().label(new Label().show(true)));
        line4.name("搜索引擎").stack("总量").smooth(true).symbolSize(6).symbol(Symbol.emptyCircle).itemStyle(itemStyle4);
        line4.data(620, 732, 791, 734, 890, 930, 820);
        option.series(line1, line2, line3, line4);
        Log.d("折线图", option.toString());
        mWebView.setJsonFromOption(option);
    }

    /**
     * 对数轴
     */
    private void numberAxis() {
        GsonOption option = new GsonOption();
        option.tooltip(Trigger.item).legend(new Legend().x(X.left).data("2的指数", "3的指数"));
        CategoryAxis xAxis = new CategoryAxis();
        xAxis.name("x").splitLine(new SplitLine().show(false)).data("一", "二", "三", "四", "五", "六", "七", "八", "九");
        option.xAxis(xAxis).yAxis(new LogAxis().name("y")).calculable(false);
        Line line1 = new Line().name("3的指数").data(1, 3, 9, 27, 81, 247, 741, 2223, 6669);
        Line line2 = new Line().name("2的指数").data(1, 2, 4, 8, 16, 32, 64, 128, 256);
        option.series(line1, line2);
        Log.d("对数轴", option.toString());
        mWebView.setJsonFromOption(option);
    }

    private void toolboxFeature(Toolbox toolbox) {
        toolbox.show(true);
        Map map = toolbox.feature();
        map.put("mark", new Mark().show(true));
        map.put("dataView", new DataView().show(true).readOnly(false));
        map.put("magicType", new MagicType().show(true).type(new String[]{"line", "bar"}));
        map.put("restore", new Restore().show(true));
        map.put("saveAsImage", new SaveAsImage().show(true));
    }

